DROP TABLE IF EXISTS `address`;
CREATE TABLE `address` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增列',
  `code` varchar(40) NOT NULL COMMENT '代码',
  `name` varchar(50) NOT NULL COMMENT '名称',
  `short_name` varchar(30) NOT NULL COMMENT '简称',
  `parent_code` varchar(40) DEFAULT NULL COMMENT '父级代码',
  `level` tinyint(4) NOT NULL COMMENT '层级',
  `lng` varchar(20) DEFAULT NULL COMMENT '经度',
  `lat` varchar(20) DEFAULT NULL COMMENT '纬度',
  `sort` int(6) DEFAULT NULL COMMENT '排序',
  PRIMARY KEY (`id`),
  KEY `idx_code_level` (`code`, `level`),
  KEY `idx_name_level` (`name`, `level`),
  KEY `idx_parent_code` (`parent_code`)
) ENGINE=InnoDB COMMENT='地址表';

